import React from "react";
const Login =() => {
    const heading = "Welcome to Login Page";
    return (
        <div classname = "Login_Layout">
            <h1> <b> "Welcome to Login Page"  </b></h1>
            <h1> Enter Your User Id </h1>
            <form>
                <label> First Name;
                    <input type="numbers" id="user_id" name="user_id"/>
                </label>
                <label> Last Name;
                    <input type="password" id="lastname" name="password"/>
                </label>
            </form>
        </div>
    );

    
}
export default Login;
